import React from 'react';
import logo from './logo.svg';
import './App.css';
import { userInfo } from 'os';
interface IProps {
}

interface IState {
  value: string;
  check: boolean;
}
class Welcome extends React.Component {
  render() {
    return (
      <h1>Welcome</h1>
    )
  }
}
class ComeBack extends React.Component {
  render() {
    return (
      <h1>ComeBack</h1>
    )
  }
}
class App extends React.Component<IProps, IState> {
  constructor(props: any) {
    super(props);
    this.state = {
        value: '',
        check: false
    }
    this.changeValue = this.changeValue.bind(this)
  }
  changeValue(event: any) {
    this.setState({
      value: event.target.value
    })
  }
  render() {
    let check: any;
    let renderPart: any;
    if (check)  renderPart = <Welcome />
    else renderPart = <ComeBack />
    return (
    <div>
      <div>
        Name:<input type="text" value={this.state.value} onChange={this.changeValue}/>
      </div>
      <div>
        Name2:<input type="text" value={this.state.value} onChange={this.changeValue}/>
      </div>
      <div>
        <button value="login" onClick={this.changeValue}></button>
        <button value="register" onClick={this.changeValue}></button>
        {renderPart}
      </div>
    </div>
  );
    }
}

export default App;
